import { Link } from "react-router-dom";
import Bus from "../../assets/images/bus5.png";
import logo from "../../assets/images/busfin.png"
import { useState } from "react";

const WebNav = () => {
    const [isLoggedIn, setIsLoggedIn] = useState(true); // Set initial login state
    const [expandNav, setExpandNav] = useState(false); // Set initial state for menu expansion
    const [selectedOption, setSelectedOption] = useState(""); // State to manage dropdown selection
    const [arrow,setArrow]=useState('down');

    const handleOptionChange = (event) => {
        setSelectedOption(event.target.value);
    };

    const handleSignOut = () => {
        // Perform sign out actions here, such as clearing session, etc.
        setIsLoggedIn(false);
    };

    // Toggle menu function
    const handleMenu = () => {
        setExpandNav(!expandNav);
        if(arrow==='down'){
            setArrow( 'up' );
        }
        else if(arrow==='up'){
            setArrow('down');
        }
    };

    // Render sign in/sign out link based on login state
    const renderAuthLink = () => {
        if (isLoggedIn) {
            return (
                <div className='webnav_area w-full py-4'>
                    <div className="flex items-center relative">
                        <div className="cursor-pointer flex items-center" onClick={() => handleMenu()}>
                            <span className="mr-2">Account</span>

                        </div>
                        {expandNav && (
                            <div className="absolute top-full right-0 bg-white p-2 border rounded shadow-md w-64">
                                <ul>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/profile">Profile</Link></li>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/my-bookings">My Bookings</Link></li>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/cancel-tickets">Cancel Tickets</Link></li>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/show-my-ticket">Show My Ticket</Link></li>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><button onClick={handleSignOut}>Sign Out</button></li>
                                </ul>
                            </div>
                        )}
                    </div>
                </div>
            );
        } else {
            return (
                <div className="flex-item">
                    <Link to="/sign-in" className="border-1-custom py-2 px-4 rounded-md transition-all duration-300 hover:bg-gray-300">Sign In or Register</Link>
                </div>
            );
        }
    };

    return (
        <div className='webnav_area w-full py-4'>
            <div className="max-w-6xl w-full px-4 lg:px-0 mx-auto">
                <div className="flex items-center justify-between flex-wrap font-bold">
                    <div className="flex-item">
                        <Link to="/">
                            <img src={ logo } className="w-12 inline mr-1" alt="bus" />
                            <h2 className='text-3xl font-extrabold inline' >
                                fATA-fAT Yatra 
                            </h2>
                        </Link>
                    </div>

                    {/* <div className="flex items-center space-x-3"> */}

                        <div className="flex-item hidden lg:block">
                        <Link to="/busses" className='mr-3 border-1-custom py-2 px-4 rounded-full transition-all duration-300 hover:bg-gray-300'>
                            <img src={ Bus } className="w-5 inline mr-1" alt="bus" />
                            <span>Buses</span>
                        </Link>
                        </div>
                        <div className="flex items-center relative">
                            <div className="cursor-pointer flex items-center" onClick={() => {handleMenu()}}>
                                <span className="mr-2">Account</span>
                                {arrow==='down' ?(
                                    <svg height="24" viewBox="0 0 24 24" width="24" xmlns="http://www.w3.org/2000/svg"><path d="M11.178 19.569a.998.998 0 0 0 1.644 0l9-13A.999.999 0 0 0 21 5H3a1.002 1.002 0 0 0-.822 1.569l9 13z"/></svg>
                                ) : (
                                    <svg height="24" viewBox="0 0 24 24" width="24" xmlns="http://www.w3.org/2000/svg"><path d="M3 19h18a1.002 1.002 0 0 0 .823-1.569l-9-13c-.373-.539-1.271-.539-1.645 0l-9 13A.999.999 0 0 0 3 19z"/></svg>
                                )
                                }
                            </div>
                            {expandNav && (
                                <div className="absolute top-full right-0 bg-white p-4 border rounded shadow-md w-64">
                                    <ul>
                                        <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/profile">Profile</Link></li>
                                        <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/my-bookings">My Bookings</Link></li>
                                        <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/cancel-tickets">Cancel Tickets</Link></li>
                                        <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/show-my-ticket">Show My Ticket</Link></li>
                                        <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><button onClick={handleSignOut}>Sign Out</button></li>
                                    </ul>
                                </div>
                            )}
                        </div>

                    {/* </div> */}
                </div>
            </div>
        </div>
    );
};

export default WebNav;
